import React, { Component } from 'react';
import './App.css';

import UploadForm from './components/PhotosUploader';
import form from './components/form';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <UploadForm />
        </header>
      </div>
    );
  }
}

export default App;
